import React, {Component} from 'react';
import CollectionRender from "../../Components/Home/Collections/CollectionRender";
import Menu from "../../Components/Menu/Menu";
import Logo from "../../Components/Logo/Logo";
import NewsletterInfo from "../../Components/NewsletterInfo/Newsletter_Info";
import BottomInfo from "../../Components/BottomInfo/BottomInfo";
import $ from "jquery"


class Home extends Component {
  
  constructor() {

  super()
  this.state = {
    collectionName: "Casablanca"
  }
}
  render() {

    
    

    console.log(this.state.collectionName)
    $(window).bind('mousewheel DOMMouseScroll', function(event){
      this.setState({collectionName: "Marocco"})

      console.log(this.state.collectionName)
    })

    console.log(this.state.collectionName)

    return (
        <div className="home">
          <NewsletterInfo />
          <Logo />
          <Menu />
          <CollectionRender collectionName={this.state.collectionName} />
          <BottomInfo />
        </div>
    );
  }
}

export default Home;
